import React, { useState } from 'react';

const ViewServices = () => {
  const [services, setServices] = useState([
    {
      id: 1,
      name: 'Standard Parking',
      location: '123 Main St, Anytown USA',
      price: 10,
      availability: true,
      description: 'A standard parking space.',
      image: 'https://example.com/parking.jpg',
      slots: 50
    },
    {
      id: 2,
      name: 'Premium Parking',
      location: '456 Broad St, Anytown USA',
      price: 20,
      availability: false,
      description: 'A premium parking space.',
      image: 'https://example.com/premium-parking.jpg',
      slots: 10
    }
  ]);

  return (
    <div>
      {services.map(service => (
        <div key={service.id}>
          <h2>{service.name}</h2>
          <p>{service.location}</p>
          <p>{`$${service.price} per hour`}</p>
          <p>{service.availability ? 'Available' : 'Not available'}</p>
          <p>{service.description}</p>
          <img src={service.image} alt={service.name} />
          <p>{`${service.slots} slots available`}</p>
        </div>
      ))}
    </div>
  );
};

export default ViewServices;
